import React from 'react';

function Section(props) {
  const aboutUsData = props.aboutUsData;

  return (
    <section id="about" className="about">
      <h1 className="heading">{aboutUsData.heading}</h1>
      <div className="row">
        <div className="content">
          <h3>{aboutUsData[0].subHeading}</h3>
          <p>{aboutUsData[0].content}</p>
          <a href="#"><button className="btn">{aboutUsData[0].btn}</button></a>
        </div>
      </div>
    </section>
  );
}

export default Section;
